import React, { Component } from 'react';

class Wallets extends React.Component{

  constructor(props){
    super(props);
  }

  parseFunctions = {
    sei: this.parseSei
  }

   getHtml(url){
    fetch(url).then(function (response) {
        // The API call was successful!
        return response.text();
    }).then(function (html) {
        // This is the HTML from our response as a text string
        console.log(html);
    }).catch(function (err) {
        // There was an error
        console.warn('Something went wrong.', err);
    });
    return 0;
  }


  parseSei(address){
    let link = "https://www.seiscan.app/pacific-1/accounts/"+address+"/assets";
    getHtml(link);
    console.log(link);
  }

  render(){
